import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState, useEffect } from 'react';
//import { Button } from './Button';
import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  const [click, setClick] = useState(false);
  const [button, setButton] = useState(true);

  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  const showButton = () => {
    if (window.innerWidth <= 960) {
      setButton(false);
    } else {
      setButton(true);
    }
  };

  useEffect(() => {
    showButton();
  }, []);

  window.addEventListener('resize', showButton);

  return (
    <>
    <navbar>
    <header class="header-section navbar navbar-fixed-top navbar-default">
				<div class="container"><div class="navbar-header">

						{/* <!-- RESPONSIVE MENU BUTTON --> */}
						<button type="button" class="navbar-toggle" id="toggle-menu">
							<span class="sr-only">Toggle navigation</span>
							<span class="icon-bar"></span>
							<span class="icon-bar"></span>
							<span class="icon-bar"></span>
						</button>


						{/* <!-- NAVBAR LOGO --> */}
						<a class="navbar-logo weblogo" href="index"><img src="images/logos/helpr-logo.png" alt="Hire Home Cleaning, Pest Control, Plumbing, Electrical, Carpentry, Home appliances Service and Repair Professionals from Helpr.in"/></a><a class="navbar-logo moblogo" href="home"><img src="images/logos/helpr-logo@2x.png" alt="Hire Home Cleaning, Pest Control, Plumbing, Electrical, Carpentry, Home appliances Service and Repair Professionals from Helpr.in" /></a></div>

					<div id="navigation" class="navbar-collapse collapse">
                     <div class="callHelp" style="display: none;">7676 000 300</div>
						<a href="javascript:;" class="getApp">Get the App</a>
                    <div class="getapp-container" style="display:none;">
                    	<div class="topBorWhite"></div>
                        <div class="getapp-title">Get an SMS with the App Install link. Book and get Rs.100 OFF on your first service</div>
                        <div class="getapp-phone-container clearfix">
                        	{/* <input type="text" class="getAppText" name="getAppMobile" id="getAppMobile" value="" placeholder="Enter 10 digit mobile number" maxlength="10" onkeypress="return isNumberKey(event)" onkeydown="if(event.keyCode == 13){ subscribe1('','','','','','','','','','','','helpr.in/index','%5B%5D')}"><a href="javascript:;" class="getAppLink" onClick="subscribe1('','','','','','','','','','','','helpr.in/index','%5B%5D')">GET LINK</a><div class="alertText"></div> */}
                          </div>
                          <div class="getapp-download" style="display:none;"><a href="https://itunes.apple.com/in/app/helpr-pest-control-cleaning/id1037210450?ls=1&mt=8" target="_blank"><img src="images/appstore.png" alt="Appstore" width="105"/></a>&nbsp;&nbsp;&nbsp;&nbsp;<a href="https://play.google.com/store/apps/details?id=com.helprtech.helpr" target="_blank"><img src="images/googlestore.png" alt="Google Play" width="105"/></a></div>
                    </div>

						{/* <!-- NAVIGATION LINKS --> */}
						<ul class="nav navbar-nav navbar-left">

                            <li class=""><a href="cleaning" class="dropdwn">Services</a>
                            <ul>
      <li class=""><a href="cleaning" class="clearfix"><div class="cln_cir nav_cir"></div><span>Cleaning</span></a></li>
      <li class=""><a href="pestcontrol" class="clearfix"><div class="pest_cir nav_cir"></div><span>Pest Control</span></a></li>
       <li class=""><a href="courierservice" class="clearfix"><div class="computer_cir nav_cir"></div><span>Courier Services</span></a></li>
       <li class=""><a href="relocation" class="clearfix"><div class="vehicle_cir nav_cir"></div><span>Relocation</span></a></li>

    </ul></li>
    <li class=""><a href="subscriptions" class="dropdwn">Subscriptions</a>
    	<ul>

            <li class=""><a href="homespa" class="clearfix"><div class="hs_cir nav_cir"></div><span>Home Spa</span></a></li>
            <li class=""><a href="homeguard" class="clearfix"><div class="hg_cir nav_cir"></div><span>Home Guard</span></a></li>


      </ul>
    </li>
     <li class=""><a href="about">About</a></li>
	<li class=""><a href="contact">Contact</a></li>

						</ul>

					</div>
                   </div>
			</header>
      </navbar>
    </>
  );
}

export default Navbar;
